script: |
  super -f text -I q8351.spq | sort > q8351.out

inputs:
  - name: q8351.spq
    data: |
      SELECT ALL * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col1 NOT IN ( col0 * + col0 / + + col1, - 53 * + col0 * + col2 * + col1, + - ( ( ( - col2 ) ) ) * 22, + ( - + col2 ) * + - col2 + + + col1 );
  - name: tab0

outputs:
  - name: q8351.out
    data: |
